  false,\n\t\"url\": null,\n\t\"notes\": \"Maine's coastal islands and beaches provide
  important nesting habitat for piping plover (Charadrius melodus), least tern (Sterna
  antillarum), common tern (Sterna hirundo), Arctic tern (Sterna paradisaea), Atlantic
  puffin (Fratercula arctica), black guillemot (Cepphus grylle), and common eider
  (Somateria mollissima). These species are managed and regularly monitored by the
  U.S. Fish and Wildlife Service (USFWS), National Audubon Society (NAS), Maine Department
  of Inland Fisheries and Wildlife (MDIFW), BioDiversity Research Institute (BRI),
  Maine Audubon Society (MAS) and other partners in the Gulf of Maine Seabird Working
  Group. Each nesting season, these organizations collect nonviable and abandoned
  eggs when available. Relatively few contaminant investigations have been performed
  with birds at coastal sites in Maine. In particular, little is known about mercury
  exposure in bird species using coastal beaches and islands. To address this data
  gap, we summarize mercury exposure in nonviable and abandoned bird eggs collected
  between 1993 and 2004 from ten locations along the Maine coast. Eighty-two eggs
  from seven species were collected. Fifty eggs were analyzed individually for mercury
  and 32 eggs were formed into six species-specific composites prior to analysis.\",\n\t\"owner_org\":
